const MainLayout = ({ children }) => {
  return (
    <div className='relative w-[1600px] h-[1200px]'>
      <div className='absolute w-[236px] h-[1628.49px] bg-transparent rotate-12 left-[-47.43px] top-[-186px]' />
      <div className='absolute w-[236px] h-[1628.49px] bg-transparent rotate-12 left-[460.57px] top-[-111px]' />
      <div className='absolute w-[236px] h-[1628.49px] bg-transparent rotate-12 left-[460.57px] top-[-111px]' />
      <div className='absolute w-[236px] h-[1628.49px] bg-transparent rotate-12 left-[460.57px] top-[-111px]' />
      { children }
    </div>
  )
}

export default MainLayout
